        [TestMethod]
        public void CoreOpcode6502Tests()
        {
            // Arrange
            var bus = new Bus();

            var codeBytes = File.ReadAllBytes("TestBinaries\\6502_functional_test.bin");
            bus.LoadProgram(0x0400, codeBytes, 0x0400);

            // Act & Asssert
            var cycleCount = 0;
            do
            {
                bus._cpu.step();
                cycleCount++;

                // ASSERT TEST SUCCESS AS THEY ARE COMPLETED
                if (bus._cpu.PC == 0x0461)
                    Assert.AreEqual(0x01, bus._cpu.A, "Load Data");
                else if (bus._cpu.PC == 0x05aa)
                    Assert.AreEqual(0x02, bus._cpu.A, "BNE Relative Addressing Test");
                else if (bus._cpu.PC == 0x05f1)
                    Assert.AreEqual(0x03, bus._cpu.A, "Partial test BNE & CMP, CPX, CPY immediate");
                else if (bus._cpu.PC == 0x0625)
                    Assert.AreEqual(0x04, bus._cpu.A, "Testing stack operations PHA PHP PLA PLP");
                else if (bus._cpu.PC == 0x079f)
                    Assert.AreEqual(0x05, bus._cpu.A, "Testing branch decisions BPL BMI BVC BVS BCC BCS BNE BEQ");
                else if (bus._cpu.PC == 0x089b)
                    Assert.AreEqual(0x06, bus._cpu.A, "Test PHA does not alter flags or accumulator but PLA does");
                else if (bus._cpu.PC == 0x08cf)
                    Assert.AreEqual(0x07, bus._cpu.A, "Partial pretest EOR #");
                else if (bus._cpu.PC == 0x0919)
                    Assert.AreEqual(0x08, bus._cpu.A, "PC modifying instructions except branches (NOP, JMP, JSR, RTS, BRK, RTI)");
                else if (bus._cpu.PC == 0x096f)
                    Assert.AreEqual(0x09, bus._cpu.A, "Jump absolute");
                else if (bus._cpu.PC == 0x09ab)
                    Assert.AreEqual(0x0A, bus._cpu.A, "Jump indirect");
                else if (bus._cpu.PC == 0x09e2)
                    Assert.AreEqual(0x0B, bus._cpu.A, "Jump subroutine & return from subroutine");
                else if (bus._cpu.PC == 0x0a14)
                    Assert.AreEqual(0x0C, bus._cpu.A, "Break and return from RTI");
                else if (bus._cpu.PC == 0x0aba)
                    Assert.AreEqual(0x0D, bus._cpu.A, "Test set and clear flags CLC CLI CLD CLV SEC SEI SED");
                else if (bus._cpu.PC == 0x0d80)
                    Assert.AreEqual(0x0E, bus._cpu.A, "testing index register increment/decrement and transfer INX INY DEX DEY TAX TXA TAY TYA ");
                else if (bus._cpu.PC == 0x0e49)
                    Assert.AreEqual(0x0F, bus._cpu.A, "TSX sets NZ - TXS does not");
                else if (bus._cpu.PC == 0x0f04)
                    Assert.AreEqual(0x10, bus._cpu.A, " Testing index register load & store LDY LDX STY STX all addressing modes LDX / STX - zp,y / abs,y");
                else if (bus._cpu.PC == 0x0f46)
                    Assert.AreEqual(0x11, bus._cpu.A, "Indexed wraparound test (only zp should wrap)");
                else if (bus._cpu.PC == 0x0ffd)
                    Assert.AreEqual(0x12, bus._cpu.A, "LDY / STY - zp,x / abs,x");
                else if (bus._cpu.PC == 0x103d)
                    Assert.AreEqual(0x13, bus._cpu.A, "Indexed wraparound test (only zp should wrap)");
                else if (bus._cpu.PC == 0x1333)
                    Assert.AreEqual(0x14, bus._cpu.A, "LDX / STX - zp / abs / #");
                else if (bus._cpu.PC == 0x162d)
                    Assert.AreEqual(0x15, bus._cpu.A, "LDY / STY - zp / abs / #");
                else if (bus._cpu.PC == 0x16de)
                    Assert.AreEqual(0x16, bus._cpu.A, "Testing load / store accumulator LDA / STA all addressing modes LDA / STA - zp,x / abs,x");
                else if (bus._cpu.PC == 0x16de)
                    Assert.AreEqual(0x17, bus._cpu.A, "LDA / STA - (zp),y / abs,y / (zp,x)");
                else if (bus._cpu.PC == 0x189c)
                    Assert.AreEqual(0x18, bus._cpu.A, "Indexed wraparound test (only zp should wrap)");
                else if (bus._cpu.PC == 0x1b66)
                    Assert.AreEqual(0x19, bus._cpu.A, "LDA / STA - zp / abs / #");
                else if (bus._cpu.PC == 0x1cba)
                    Assert.AreEqual(0x1A, bus._cpu.A, "testing bit test & compares BIT CPX CPY CMP all addressing modes BIT - zp / abs");
                else if (bus._cpu.PC == 0x1dc8)
                    Assert.AreEqual(0x1B, bus._cpu.A, "CPX - zp / abs / # ");
                else if (bus._cpu.PC == 0x1ed6)
                    Assert.AreEqual(0x1C, bus._cpu.A, "CPY - zp / abs / # ");
                else if (bus._cpu.PC == 0x22ba)
                    Assert.AreEqual(0x1D, bus._cpu.A, "CMP - zp / abs / # ");
                else if (bus._cpu.PC == 0x23fe)
                    Assert.AreEqual(0x1E, bus._cpu.A, "Testing shifts - ASL LSR ROL ROR all addressing modes shifts - accumulator");
                else if (bus._cpu.PC == 0x257e)
                    Assert.AreEqual(0x1F, bus._cpu.A, "Shifts - zeropage");
                else if (bus._cpu.PC == 0x2722)
                    Assert.AreEqual(0x20, bus._cpu.A, "Shifts - absolute");
                else if (bus._cpu.PC == 0x28a2)
                    Assert.AreEqual(0x21, bus._cpu.A, "Shifts - zp indexed");
                else if (bus._cpu.PC == 0x2a46)
                    Assert.AreEqual(0x22, bus._cpu.A, "Shifts - abs indexed");
                else if (bus._cpu.PC == 0x2af0)
                    Assert.AreEqual(0x23, bus._cpu.A, "testing memory increment/decrement - INC DEC all addressing modes zeropage");
                else if (bus._cpu.PC == 0x2baa)
                    Assert.AreEqual(0x24, bus._cpu.A, "absolute memory");
                else if (bus._cpu.PC == 0x2c58)
                    Assert.AreEqual(0x25, bus._cpu.A, "zeropage indexed");
                else if (bus._cpu.PC == 0x2d16)
                    Assert.AreEqual(0x26, bus._cpu.A, "memory indexed");
                else if (bus._cpu.PC == 0x2f0e)
                    Assert.AreEqual(0x27, bus._cpu.A, "Testing logical instructions - AND EOR ORA all addressing modes AND");
                else if (bus._cpu.PC == 0x3106)
                    Assert.AreEqual(0x28, bus._cpu.A, "EOR");
                else if (bus._cpu.PC == 0x32ff)
                    Assert.AreEqual(0x29, bus._cpu.A, "OR");
                else if (bus._cpu.PC == 0x3364)
                    Assert.AreEqual(0x2A, bus._cpu.A, "full binary add/subtract test iterates through all combinations of operands and carry input uses increments/decrements to predict result & result flags");
                else if (bus._cpu.PC == 0x3408)
                    Assert.AreEqual(0x2B, bus._cpu.A, "Binary Switch Test");
                else if (bus._cpu.PC == 0x3463)
                    Assert.AreEqual(0xF0, bus._cpu.A, "decimal add/subtract test  *** WARNING - tests documented behavior only! ***   only valid BCD operands are tested, N V Z flags are ignored iterates through all valid combinations of operands and carry input uses increments/decrements to predict result & carry flag");

                // CHECK FOR TEST COMPELTION
                if (bus._cpu.PC == 0x3463)
                    break;

                // CHECK FOR SOME BAD LOOPAGE OR FAILED TEST
                if (cycleCount > 31000000)
                    Assert.Fail("Deadlocked at PC " + bus._cpu.PC.ToString("X4"));
            } while (true);
        }

        [TestMethod]
        public void ExtendedOpcode65C02Tests()
        {
            // Arrange
            var bus = new Bus();

            var codeBytes = File.ReadAllBytes("TestBinaries\\65C02_extended_opcodes_test.bin");
            bus.LoadProgram(0x0000, codeBytes, 0x0400);

            // Act & Asssert
            var cycleCount = 0;
            do
            {
                bus._cpu.step();
                cycleCount++;

                // ASSERT TEST SUCCESS AS THEY ARE COMPLETED
                if (bus._cpu.PC == 0x0472)
                    Console.WriteLine("0472 -> test PHX does not alter flags or X but PLX does");
                else if (bus._cpu.PC == 0x065e)
                    Console.WriteLine("065e- >PC modifying instructions(BRA, BBR, BBS, 1, 2, 3 byte NOPs, JMP(abs, x))");
                else if (bus._cpu.PC == 0x071c)
                    Console.WriteLine("071c->testing BBR & BBS");
                else if (bus._cpu.PC == 0x0c04)
                    Console.WriteLine("0c04->testing NOP");
                else if (bus._cpu.PC == 0x1660)
                    Console.WriteLine("1660->ump indirect(test page cross bug is fixed) ");
                else if (bus._cpu.PC == 0x16ac)
                    Console.WriteLine("16ac->jump indexed indirect");
                else if (bus._cpu.PC == 0x1714)
                    Console.WriteLine("1714->test BRK clears decimal mode");
                else if (bus._cpu.PC == 0x176c)
                    Console.WriteLine("176c->testing accumulator increment/ decrement INC A &DEC A");
                else if (bus._cpu.PC == 0x182c)
                    Console.WriteLine("182c->testing load / store accumulator LDA / STA(zp)");
                else if (bus._cpu.PC == 0x1957)
                    Console.WriteLine("1957->testing STZ - zp / abs / zp,x / abs,x");
                else if (bus._cpu.PC == 0x1aee)
                    Console.WriteLine("1aee->testing BIT - zp,x / abs,x / #");
                else if (bus._cpu.PC == 0x1d05)
                    Console.WriteLine("1d05->testing TRB, TSB - zp / abs");
                else if (bus._cpu.PC == 0x1e69)
                    Console.WriteLine("1e69->testing RMB, SMB - zp");
                else if (bus._cpu.PC == 0x2236)
                    Console.WriteLine("2236->testing CMP - (zp)");
                else if (bus._cpu.PC == 0x22cb)
                    Console.WriteLine("22cb->testing logical instructions -AND EOR ORA(zp)");
                else if (bus._cpu.PC == 0x23b8)
                    Console.WriteLine("23b8->full binary add/ subtract test - (zp)only");
                else if (bus._cpu.PC == 0x242a)
                    Console.WriteLine("242a-> decimal add/ subtract test");
                else if (bus._cpu.PC == 0x24f1)
                    Console.WriteLine("24f1->success");

                // CHECK FOR TEST COMPELTION
                if (bus._cpu.PC == 0x24f1)
                    break;

                // CHECK FOR SOME BAD LOOPAGE OR FAILED TEST
                if (cycleCount > 30000000)
                    Assert.Fail("Deadlocked at PC " + bus._cpu.PC.ToString("X4"));
            } while (true);
        }

        [TestMethod]
        public void TestSimpleAssemble()
        {
            // Arrange
            var bus = new Bus();
            var program =   ".org    $8000\n" +
                            "    LDX    #$0A\n" +
                            "    STX    $0000\n" +
                            "    LDX    #$03\n" +
                            "    STX    $0001\n" +
                            "    LDY    $0000\n" +
                            "    LDA    #$00\n" +
                            "    CLC\n" +
                            "loop:\n" +
                            "    ADC    $0001\n" +
                            "    DEY\n" +
                            "    BNE    loop\n" +
                            "    STA    $0002\n" +
                            "    NOP\n" +
                            "    NOP\n" +
                            "    NOP\n";

            var expected = new byte[] { 0xA2, 0x0A, 0x8E, 0x00, 0x00, 0xA2, 0x03, 0x8E, 0x01, 0x00, 0xAC, 0x00, 0x00, 0xA9, 0x00, 0x18, 0x6D, 0x01, 0x00, 0x88, 0xD0, 0xFA, 0x8D, 0x02, 0x00, 0xEA, 0xEA, 0xEA };

            // Act
            var actual = bus._cpu.assemble(program);

            // Assert
            var actualString = string.Join(" ", actual.Select(p => p.ToString("X2")).ToArray());
            var expectedString = string.Join(" ", expected.Select(p => p.ToString("X2")).ToArray());
            Assert.AreEqual(expectedString, actualString);
        }

        [TestMethod]
        public void SimpleAdditionTest()
        {
            // Arrange
            var bus = new Bus();

            var code = "A2 0A 8E 00 00 A2 03 8E 01 00 AC 00 00 A9 00 18 6D 01 00 88 D0 FA 8D 02 00 EA EA EA";
            bus.LoadProgram(0x8000, code, 0x8000);

            var cycleCount = 0;
            do
            {
                bus._cpu.step();
                cycleCount++;

                // CHECK FOR TEST COMPELTION
                if (bus._cpu.PC == 0x801B)
                {
                    // Verify Registers
                    Assert.AreEqual(0x1E, bus._cpu.A);
                    Assert.AreEqual(0x03, bus._cpu.X);
                    Assert.AreEqual(0x00, bus._cpu.Y);

                    // Verify Memory Looks Right
                    Assert.AreEqual(0x0A, bus.read(0x0000));
                    Assert.AreEqual(0x03, bus.read(0x0001));
                    Assert.AreEqual(0x1E, bus.read(0x0002));
                    break;
                }

                // CHECK FOR SOME BAD LOOPAGE OR FAILED TEST
                if (cycleCount > 31000000)
                    Assert.Fail("Deadlocked at PC " + bus._cpu.PC.ToString("X4"));
            } while (true);
        }

