                    Assert.IsTrue(true, "IRQ test");
                else if (bus._cpu.PC == 0x05cc)
                    Assert.IsTrue(true, "BRK test");
                else if (bus._cpu.PC == 0x06b7)
                    Assert.IsTrue(true, "NMI test");
                else if (bus._cpu.PC == 0x06ec)
                    Assert.IsTrue(true, "Disable Interrupt test");

                // TEST COMPLETE
                if (bus._cpu.PC == 0x06ec)
                    break;

                // CHECK FOR FAILURE
                if (cycleCount > 100000)
                    Assert.Fail("Deadlocked at PC " + bus._cpu.PC.ToString("X4"));
            }
        }
    }
}
